import React from 'react';
export default function RecruitingTools() {
  return <div className="max-w-2xl mx-auto py-20 text-center">
    <h1 className="text-3xl font-bold mb-4">Recruiting Tools</h1>
    <p className="text-gray-600 mb-4">Powerful tools to help you hire better:</p>
    <ul className="text-left mx-auto max-w-md text-gray-700 dark:text-gray-300">
      <li className="mb-2">• Applicant tracking</li>
      <li className="mb-2">• Team collaboration</li>
      <li className="mb-2">• Automated interview scheduling</li>
      <li className="mb-2">• Analytics dashboard</li>
    </ul>
  </div>;
}
